import React from 'react';
import axios from 'axios';

class MyPageDefault extends React.Component {
  constructor(){
    super();
    this.state = {
      userDatas:[]
    }
  }

  componentWillMount(){
    const userIdStatus = localStorage.getItem('userData')
    console.log(userIdStatus.id)
    const request = axios.create({
      baseURL: 'http://18.178.35.28:3001'
    })

    request.get(`/users/${this.userIdStatus}`)
    .then(res => {
      this.setState({
        userDatas: res.data
      });
    })
  }

  render() {
    console.log('aaaaa');
    return (
      <div className="myPageDefault">
        <div className="userStatus">
          <div className="icon">
            <img src={this.state.userDatas.u_icon} alt={this.state.userDatas.u_name} />
          </div>
          <div className="userName">
            <h2>{this.state.userDatas.u_name}</h2>
          </div>
        </div>
      </div>
    )
  }
}

export default MyPageDefault;
